/*********************************************************************************************************
	CREATED BY: Yogalakshmi				STORED PROCEDURE NAME: usp_efile_hold_attachment_insert
	CREATED ON: 9th May 2014
*********************************************************************************************************/

CREATE PROCEDURE [dbo].[usp_efile_hold_attachment_insert]
	@efile_hold_id INT,
	@efile_attachment VARBINARY(MAX),
	@type VARCHAR(50) = NULL,
	@attachment_name VARCHAR(50) = NULL
AS


SET NOCOUNT ON    
	BEGIN     
		DECLARE @Date DATETIME, @EfileHoldID INT    
		SET @Date = GETDATE()    
		IF EXISTS (SELECT 1 FROM [dbo].[efile_hold] WITH(NOLOCK) WHERE [return_id] = @return_id AND [is_deleted] = 0)  
			BEGIN  
			 UPDATE [dbo].[efile_hold] WITH(ROWLOCK)  
			 SET 
				 [is_deleted]=1 , 
				 [update_time_stamp] = @Date   
			 WHERE 
				[return_id] = @return_id  
			 INSERT INTO [dbo].[efile_hold]
			 (
				 [sender_id], 
				 [tax_return_type_id],
				 [return_id] , 
				 [no_of_attachments], 
				 [user_id], 
				 [user_name],
				 [user_email],
				 [tax_object], 
				 [env_indicator], 
				 [efile_trans_id], 
				 [is_deleted], 
				 [create_time_stamp], 
				 [update_time_stamp],
				 [tax_year],
				 [tax_period]
			 )     
			 VALUES 
			 (
				 @sender_id, 
				 @tax_return_type_id,
				 @return_id,
				 @no_of_attachments,
				 @user_id,
				 @user_name,
				 @user_email,
				 @tax_object,
				 @env_indicator, 
				 @efile_trans_id, 
				 0, 
				 @Date, 
				 @Date,
				 @tax_year,
				 @tax_period
			 )    
			 SET @EfileHoldID=@@Identity     
			 SELECT @EfileHoldID AS 'EfileHoldID'    
			 EXEC StatusUpdate NULL, @EfileHoldID, @status_id,@stage,@state  
			END   
		ELSE  
			INSERT INTO [dbo].[efile_hold]
			 (
				 [sender_id], 
				 [tax_return_type_id],
				 [return_id] , 
				 [no_of_attachments], 
				 [user_id], 
				 [user_name],
				 [user_email],
				 [tax_object], 
				 [env_indicator], 
				 [efile_trans_id], 
				 [is_deleted], 
				 [create_time_stamp], 
				 [update_time_stamp],
				 [tax_year],
				 [tax_period]
			 )        
			VALUES 
			(
				@sender_id, 
				@tax_return_type_id,
				@return_id, 
				@no_of_attachments,
				@user_id,
				@user_name,
				@user_email,
				@tax_object,
				@env_indicator, 
				@efile_trans_id, 
				0, 
				@Date, 
				@Date,
				@tax_year,
				@tax_period
			)    
			SET @EfileHoldID = @@Identity     
			SELECT @EfileHoldID AS 'EfileHoldID'    
			EXEC StatusUpdate NULL, @EfileHoldID, @status_id,@stage,@state  
	END
SET NOCOUNT OFF

