AS

BEGIN
	SET NOCOUNT ON; 
		INSERT INTO [dbo].[efile_receiver]
		(
			[submission_id], 
			[send_submission_status],
			[get_ack_status], 
			[ack_xml],
			[submission_status],
			[schedule1],
			[is_deleted],
			[system_id],
			[create_time_stamp],
			[update_time_stamp]
		)
		values
		(
			@submission_id, 
			@send_submission_status, 
			@get_ack_status, 
			@ack_xml,
			@submission_status,
			@schedule1,
			0,
			@irs_system_id,
			getdate(),
			getdate()
		)
		EXEC StatusUpdate @submission_id, NULL, @status_id, @stage, @state
	SET NOCOUNT OFF; 
END

